import React from "react";
import { secondsToDuration } from "../utils/duration";

function TimeRemaining({ isFocus, focusCount, breakCount }) {
  let focus = secondsToDuration(focusCount)

	if (isFocus) {
    return {}
  } else {
    return {}
  }
}

export default TimeRemaining;
